【寸法】直径24cm×H18cm・1500ml・3.6kg<br>陶板、しゃもじ、レシピ付き<br>電磁調理器使用不可、直火用<br><br><br>
白米三合なら中強火で約13～15分、<br>蒸らし20分で炊きあがります。<br><br>
火加減は必要ありません。<br><br>
炊き込みご飯、玄米もおいしく炊き上げます。<br><br>
伊賀の粗土が木のおひつのように呼吸し<br>ごはんがべたつきません。<br><br><font color="#000000" size="2.5">
【料理人に好まれる伊賀の土鍋】<br>
伊賀の地は太古の昔、琵琶湖の湖底だったため、その地層から採れる陶土は耐火度が高く、江戸時代より直火の土鍋、行平、土瓶などがこの地で作られてきました。<br>伊賀の陶土は中に炭化した植物を多く含んでいるため、焼成すると多孔性の素地になり、土鍋本体がしっかりと熱を蓄えて食材の芯までじっくりと火を通し、旨味をを逃さずおいしい料理に仕上がります。<br>またこの素地は遠赤外線効果も発揮。煮る、焼く、蒸す、炒るなどの調理器具として昔からプロの料理人に愛されてきました。<br></font>
<br><br>『長谷園　直火用かまどさん』は<br>一合、二合、三合、五合炊きがあります。<br>
<br>
<br>メーカー希望小売価格はメーカーカタログに基づいて掲載しています
